import {React, Component} from "react";

class TodoItem extends Component {
    render() { 
        return (
            <li>
                <input type = 'checkbox' 
                checked ={this.props.todo.completed} 
                onChange={()=> this.props.handleChange()} />
                {this.props.todo.title}
            </li>
        );
    }
}

export default TodoItem;
